class test_basisfunctions(NumpyTestCase):
    def setUp(self):
        self.local_edgenodes = Mesh.Element.LOCAL_EDGENODES
        self.local_facenodes = Mesh.Element.LOCAL_FACENODES
        lams = [(i,j,k,1-i-j-k)
                for i in N.arange(0,1.01, 1/3.)
                for j in N.arange(0,1.01-i, 1/3.)
                for k in N.arange(0, 1.01-i-j, 1/3.)
                ]
        lams.reverse()                  # To match the maxima order
        self.lams=N.array(lams, N.float64) # Basis fn requires ndarray
        

    def gen_values_edge(self, bf_genlist):
        return [[edgefun(coord) for coord in self.lams]
                             for edgefun in
                             [bf_gen(self.local_edgenodes)
                              for bf_gen in bf_genlist]]

    def gen_values_face(self, bf_genlist):
        return [[edgefun(coord) for coord in self.lams]
                             for edgefun in
                             [bf_gen(self.local_facenodes)
                              for bf_gen in bf_genlist]]
        
    def gen_values_vol(self, bf_genlist):
        return [[volfun(coord) for coord in self.lams]
                for volfun in bf_genlist]

    def test_zero_D(self):
        zero_D_fun = Oneform.zero_D()
        assert_equal(N.zeros((len(self.lams), 6)),
                     [zero_D_fun(coord) for coord in self.lams])

    def test_edge0(self):
        global edge_vals0
        assert_almost_equal(edge_vals0, self.gen_values_edge(Oneform.edgefuns0),
                            decimal=15)
        desired=2*N.eye(6, dtype=N.float64)
        assert_equal([edgefun_D(N.array([1/4]*4))
                      for edgefun_D in
                      [edgefun_D_g(self.local_edgenodes)
                       for edgefun_D_g in Oneform.edgefuns0_D]],
                     desired)

    def test_edge1(self):
        global edge_vals1
        assert_almost_equal(edge_vals1,
                            self.gen_values_edge(Oneform.edgefuns1),
                            decimal=15)
        assert_equal(Oneform.edgefuns1_D, (Oneform.zero_D,)*6)

    def test_edge2(self):
        global edge_vals2
        assert_almost_equal(edge_vals2, self.gen_values_edge(Oneform.edgefuns2),
                            decimal=15)
        assert_equal(Oneform.edgefuns2_D, (Oneform.zero_D,)*6)        
        
