class test_basis_set(NumpyTestCase):
    def test_1_mixed(self):
        bset = Oneform.basis_set(1, mixed=True)
        # Check default value of mixed
        assert_equal(Oneform.basis_set(1), bset)
        desired=Struct(fns=dict(edge=Oneform.edgefuns0),
                       fns_D=dict(edge=Oneform.edgefuns0_D),
                       info=Struct(form=1, type='webb99', order=0.5))
        assert_equal(bset, desired)
        self.assertRaises(AssertionError, Oneform.basis_set, 0)
        self.assertRaises(NotImplementedError, Oneform.basis_set, 1000000)

    def test_1_full(self):
        bset = Oneform.basis_set(1, mixed=False)
        desired=Struct(fns=dict(edge=Oneform.edgefuns0 + Oneform.edgefuns1),
                       fns_D=dict(edge=Oneform.edgefuns0_D + Oneform.edgefuns1_D),
                       info=Struct(form=1, type='webb99', order=1))
        assert_equal(bset, desired)

    def test_2_mixed(self):
        bset = Oneform.basis_set(2, mixed=True)
        # Check default value of mixed
        assert_equal(Oneform.basis_set(2), bset)
        desired=Struct(fns=dict(edge=Oneform.edgefuns0 + Oneform.edgefuns1,
                                face=Oneform.facefunsR2),
                       fns_D=dict(edge=Oneform.edgefuns0_D + Oneform.edgefuns1_D,
                                  face=Oneform.facefunsR2_D),
                       info=Struct(form=1, type='webb99', order=1.5))
        assert_equal(bset, desired)

    def test_2_full(self):
        bset = Oneform.basis_set(2, mixed=False)
        desired=Struct(fns=dict(edge=Oneform.edgefuns0 + Oneform.edgefuns1
                                + Oneform.edgefuns2,
                                face=Oneform.facefunsR2 + Oneform.facefunsG2),
                       fns_D=dict(edge=Oneform.edgefuns0_D + Oneform.edgefuns1_D +
                                  Oneform.edgefuns2_D,
                                  face=Oneform.facefunsR2_D + Oneform.facefunsG2_D),
                       info=Struct(form=1, type='webb99', order=2))
        assert_equal(bset, desired)

    def test_3_mixed(self):
        bset = Oneform.basis_set(3, mixed=True)
        desired=Struct(fns=dict(edge=Oneform.edgefuns0 + Oneform.edgefuns1
                                + Oneform.edgefuns2,
                                face=Oneform.facefunsR2 + Oneform.facefunsG2
                                + Oneform.facefunsR3,
                                vol=Oneform.volfunsR3),
                       fns_D=dict(edge=Oneform.edgefuns0_D + Oneform.edgefuns1_D
                                  + Oneform.edgefuns2_D,
                                  face=Oneform.facefunsR2_D + Oneform.facefunsG2_D
                                  + Oneform.facefunsR3_D,
                                  vol=Oneform.volfunsR3_D),
                       info=Struct(form=1, type='webb99', order=2.5))
        assert_equal(bset, desired)        
        
    def test_init(self):
        self.assertRaises(AssertionError, Oneform.basis_set, 0)
        self.assertRaises(NotImplementedError, Oneform.basis_set, 1000000)
                
